import React, { Component } from "react";

class Test extends Component {
	constructor() {
		super();
		this.state = {
			baban: 12
		};
	}

	render() {
		return (
			<div>
				<p> {this.state.baban}</p>
			</div>
		);
	}
}

export default Test;
